and now i would like to share the content of the announcement for gus's show in st louis;
Gus Johnson is a digital creator who’s established a presence online by making content on YouTube and Instagram. He's recently shot with Funny Or Die and is currently collaborating with Comedy Central’s digital team. He is only 24 years old and he is already running out of ideas, so he is doing a live show. He usually makes stupid videos on the internet, but this time he is making stupid comedy on stage. He is a promising, upcoming talent, and he has gained 37 pounds since high school.
here is the link: https://www.stlmag.com/events/gus-johnson-funny-die-star-live-september-18th/
